var doneImage =
    "data:image/png;base64,";
var removeImage =
    "data:image/png;base64,";
var editImage =
    "data:image/png;base64,";
var undoImage =
    "data:image/png;base64,";

var taskInput = document.getElementById("taskInput"),
    taskList = document.getElementById("taskList"),
    filter = 0;

taskList.addEventListener("click", changesLi);

function addTask() {
    if (!taskInput.value) return alert("Please enter a task.");

    var li = createLi(taskInput.value);
    taskList.prepend(li);
    taskInput.value = "";

    switch (filter) {
        case 0:
            buttons("all");
            break;
        case 1:
            buttons("active");
            break;
        case 2:
            buttons("completed");
            break;
    }
}

function createLi(title) {
    var li = document.createElement("li"),
        span = document.createElement("span"),
        div = document.createElement("div"),
        remove = document.createElement("a"),
        undo = document.createElement("a"),
        edit = document.createElement("a"),
        undoImg = document.createElement("img"),
        removeImg = document.createElement("img"),
        editImg = document.createElement("img");

    span.textContent = title;
    li.className = "task";
    div.className = "links";
    undo.href = "#";
    undo.className = "undo";
    undo.title = "undo";
    undoImg.src = undoImage;
    undo.appendChild(undoImg);
    remove.href = "#";
    remove.className = "remove";
    remove.title = "remove";
    removeImg.src = removeImage;
    remove.appendChild(removeImg);
    edit.href = "#";
    edit.className = "edit";
    edit.title = "edit";
    editImg.src = editImage;
    edit.appendChild(editImg);
    li.appendChild(span);
    li.appendChild(div);
    div.appendChild(undo);
    div.appendChild(edit);
    div.appendChild(remove);

    return li;
}

function changesLi(e) {
    if (e.target.parentElement.classList.contains("remove")) {
        e.target.parentElement.parentElement.parentElement.remove();
    } else if (e.target.parentElement.classList.contains("undo")) {
        var span = e.target.parentElement.parentElement.parentElement.querySelector(
            "span"
        );
        span.className = "completed";
        e.target.parentElement.parentElement.parentElement.querySelector(
            "img"
        ).src = doneImage;
        e.target.parentElement.parentElement.parentElement.querySelector(
            "a"
        ).className = "done";
        e.target.parentElement.parentElement.parentElement.querySelector(
            "a"
        ).title = "done";
        if (filter === 1) {
            e.target.parentElement.parentElement.parentElement.style.display =
                "none";
        }
    } else if (e.target.parentElement.classList.contains("done")) {
        var span = e.target.parentElement.parentElement.parentElement.querySelector(
            "span"
        );
        span.className = "";
        e.target.parentElement.parentElement.parentElement.querySelector(
            "img"
        ).src = undoImage;
        e.target.parentElement.parentElement.parentElement.querySelector(
            "a"
        ).className = "undo";
        e.target.parentElement.parentElement.parentElement.querySelector(
            "a"
        ).title = "undo";
        if (filter === 2) {
            e.target.parentElement.parentElement.parentElement.style.display =
                "none";
        }
    } else if (e.target.parentElement.classList.contains("edit")) {
        var span = e.target.parentElement.parentElement.parentElement.querySelector(
                "span"
            ),
            text = e.target.parentElement.parentElement.parentElement.querySelector(
                "span"
            ).textContent,
            input = document.createElement("input");
        input.type = "text";
        input.value = text;
        span.innerHTML = "";
        span.appendChild(input);
        input.focus();
        input.onblur = function() {
            span.removeChild(input);
            span.innerHTML = input.value;
        };
    }
}

function buttons(event) {
    switch (event) {
        case "all":
            filter = 0;
            document.querySelectorAll(".done").forEach(el => {
                el.parentElement.parentElement.style.display = "flex";
            });
            document.querySelectorAll(".undo").forEach(el => {
                el.parentElement.parentElement.style.display = "flex";
            });
            break;
        case "active":
            filter = 1;
            document.querySelectorAll(".undo").forEach(el => {
                el.parentElement.parentElement.style.display = "flex";
            });
            document.querySelectorAll(".done").forEach(el => {
                el.parentElement.parentElement.style.display = "none";
            });
            break;
        case "completed":
            filter = 2;
            document.querySelectorAll(".done").forEach(el => {
                el.parentElement.parentElement.style.display = "flex";
            });
            document.querySelectorAll(".undo").forEach(el => {
                el.parentElement.parentElement.style.display = "none";
            });
            break;
    }
}
